string Solution::minWindow(string S, string T) {
    map<char, int> needToFind, hasFound;
    for ( int i = 0; i < (signed)T.size(); i ++) {
        needToFind[T[i]] ++;
        hasFound[T[i]] = 0;
    }
    int begin = 0, end = 0;
    int minBegin = 0, minLen = -1;
    int count = 0;
    bool finFlag = false;
    while (end <= (signed)S.size()) {
        if (count < (signed)T.size()) {
            while ( count < (signed)T.size()) {
                if (needToFind.find(S[end]) == needToFind.end()) {
                    end ++;
                } else if ( hasFound[S[end]] >= needToFind[S[end]]) {
                    hasFound[S[end]] ++;
                    end ++;
                } else {
                    hasFound[S[end]] ++;
                    count ++;
                    end ++;
                }
                if (end == (signed)S.size())    break;
            }
            if ((count < (signed)T.size()) && (end == (signed)S.size()))    break;
        } else { // count = T.size()
            while (true) {
                if (needToFind.find(S[begin]) == needToFind.end()) {
                    begin ++;
                } else if ( hasFound[S[begin]] > needToFind[S[begin]]) {
                    hasFound[S[begin]] --;
                    begin ++;
                } else {
                    break;
                }
            }
            int len = end - begin;
            if ( (minLen == -1) || (len < minLen)) {
                minLen = len;
                minBegin = begin;
                finFlag = true;
            }
            hasFound[S[begin]] --;
            begin ++;
            count --;
            if ( end == (signed)S.size())   break;
        }
    }
    if (!finFlag)   return "";
    return S.substr(minBegin, minLen);
}

string Solution::minWindowBrute( string S, string T) {
    if (S.size() < T.size())   return "";
    if ((S.size() == 0) || (T.size() == 0)) return "";
    int minStart = -1, minLen = -1;
    // generated from T
    map<char, int> dict;
    for ( unsigned int i = 0; i < T.size(); i ++) 
        dict[T[i]] ++;
    // chars have been accessed
    map<char, list<int>> currentDict; //<char, posVector>
    list<char> accessed;

    int current = 0, charAmount = T.size();
    int currentStart = 0;
    while (current != S.size())  {
        char currentChar = S[current];
        if (dict.find(currentChar) == dict.end()) {
            current ++;
            continue;
        }
        currentDict[currentChar].push_back(current);
        accessed.push_back(currentChar);
        if (currentDict[currentChar].size() > dict[currentChar]) {
            bool flag = true;
            while(flag) {
                if (accessed.front() == currentChar)
                    flag = false;
                currentDict[accessed.front()].pop_front();
                accessed.pop_front();
            }
            currentStart = currentDict[accessed.front()].front();
        }
        if (minLen == -1)
            currentStart = current;
        current ++;
        if (accessed.size() == charAmount) {
            if ((minLen == -1)||(minLen > (current - currentStart))) {
                minStart = currentStart;
                minLen = current - currentStart;
            }
        }
    }
    if (minStart == -1) return "";
    return S.substr(minStart, minLen);
}

